<script type="text/babel">
    const { useState, useEffect, useRef } = React;

    // Helper function to convert Base64 string to a format PDF.js understands (Uint8Array)
    const base64ToUint8Array = (base64) => {
        const binary_string = window.atob(base64);
        const len = binary_string.length;
        const bytes = new Uint8Array(len);
        for (let i = 0; i < len; i++) {
            bytes[i] = binary_string.charCodeAt(i);
        }
        return bytes;
    };
    
    // The PDFPage component remains the same
    const PDFPage = ({ pdf, pageNum, className }) => {
        const canvasRef = useRef(null);
        useEffect(() => {
            if (pdf && pageNum && canvasRef.current) {
                pdf.getPage(pageNum).then(page => {
                    const scale = 2.5; const viewport = page.getViewport({ scale });
                    const canvas = canvasRef.current; const context = canvas.getContext('2d');
                    canvas.height = viewport.height; canvas.width = viewport.width;
                    page.render({ canvasContext: context, viewport: viewport });
                }).catch(err => console.error('Error rendering page:', err));
            }
        }, [pdf, pageNum]);
        return <canvas ref={canvasRef} className={className} />;
    };

    const PDFMagazineReader = () => {
        const [pdf, setPdf] = useState(null);
        const [numPages, setNumPages] = useState(0);
        const [loading, setLoading] = useState(true);
        // ... (all other state variables from before)
        const [currentPage, setCurrentPage] = useState(0);
        const [zoom, setZoom] = useState(1);
        const [isFullscreen, setIsFullscreen] = useState(false);
        const [showThumbnails, setShowThumbnails] = useState(false);
        const [isFlipping, setIsFlipping] = useState(false);
        const [flipDirection, setFlipDirection] = useState('');
        const containerRef = useRef(null);
        const [thumbnails, setThumbnails] = useState([]);

        useEffect(() => {
            loadPDF();
        }, []);

        const loadPDF = async () => {
            const pdfPath = sessionStorage.getItem('pdfUrlToLoad');

            if (!pdfPath) {
                document.getElementById('reader-container').style.display = 'none';
                document.getElementById('auth-error').style.display = 'block';
                setTimeout(() => { window.location.href = './volume-1-read.html'; }, 3000);
                return;
            }
            
            sessionStorage.removeItem('pdfUrlToLoad');

            try {
                // Fetch the scrambled text file
                const response = await fetch(pdfPath);
                const base64Data = await response.text();

                // Decode the text back into a PDF
                const pdfData = base64ToUint8Array(base64Data);

                const pdfjsLib = window['pdfjs-dist/build/pdf'];
                pdfjsLib.GlobalWorkerOptions.workerSrc = 'https://cdnjs.cloudflare.com/ajax/libs/pdf.js/3.11.174/pdf.worker.min.js';

                // Load the PDF from the decoded data
                const loadingTask = pdfjsLib.getDocument({ data: pdfData });
                const pdfDoc = await loadingTask.promise;
                
                setPdf(pdfDoc);
                setNumPages(pdfDoc.numPages);
                setLoading(false);
                // The rest of the logic remains the same
                // ... (thumbnail generation, etc.)

            } catch (error) {
                console.error('Error loading PDF:', error);
                setLoading(false);
            }
        };
